/*Table structure for table `hw_agent_order` */

DROP TABLE IF EXISTS `hw_agent_order`;

CREATE TABLE `hw_agent_order` (
  `ORDERID` bigint(20) NOT NULL auto_increment COMMENT '主键',
  `ORDERCODE` varchar(32) default NULL COMMENT '订单编号',
  `ORDERSTATUS` varchar(1) default NULL COMMENT '0:待支付；1：支付成功2：开通中3：已完成；9：已取消',
  `ORDERDESC` varchar(200) default NULL COMMENT '描述',
  `SVN` varchar(16) default NULL COMMENT '号码',
  `ORDERTYPE` varchar(16) default NULL COMMENT '订单类型',
  `PAYTYPE` varchar(16) default NULL COMMENT '预付，后付，上网卡',
  `PRODUCTID` bigint(20) default NULL COMMENT '产品ID',
  `PRESTORE` bigint(20) default NULL COMMENT '预置预存款',
  `SALEFEE` bigint(20) default NULL COMMENT '销售费用',
  `DISCOUNTFEE` bigint(20) default NULL COMMENT '折扣金额',
  `REALFEE` bigint(20) default NULL COMMENT '实收金额',
  `DISCOUNTRATE` float(20,0) default NULL COMMENT '折扣*100',
  `CREATOR` varchar(160) default NULL COMMENT '操作员',
  `PAYMODE` varchar(16) default NULL COMMENT '支付方式',
  `PAYSTATUS` varchar(16) default NULL COMMENT '支付状态',
  `CREATETIME` datetime default NULL COMMENT '创建时间',
  `PAYTIME` datetime default NULL COMMENT '支付时间',
  `COMPLETETIME` datetime default NULL COMMENT '完成时间',
  `BANKSERIAL` varchar(128) default NULL COMMENT '银联流水',
  `ZWSERIAL` varchar(128) default NULL COMMENT '账务流水',
  `SIM` varchar(64) default NULL COMMENT '卡号',
  `IMEI` varchar(64) default NULL COMMENT '硬件串号',
  `IMSI` varchar(64) default NULL COMMENT 'IMSI',
  `BANKCODE` varchar(16) default NULL,
  `BLANCE` bigint(16) default NULL COMMENT '余额',
  `UPDATETIME` date default NULL,
  `UPDATER` varchar(128) default NULL,
  `PIN` varchar(128) default NULL COMMENT 'PIN码',
  `PACKAGEFEE` bigint(16) default NULL COMMENT '套餐费',
  `SIMFEE` bigint(16) default NULL COMMENT 'SIM费用',
  `NUMBERFEE` bigint(16) default NULL COMMENT '号码费',
  PRIMARY KEY  (`ORDERID`)
) ENGINE=InnoDB AUTO_INCREMENT=3102 DEFAULT CHARSET=utf8;

