/*Table structure for table `hw_city` */

DROP TABLE IF EXISTS `hw_city`;

CREATE TABLE `hw_city` (
  `CITY_ID` bigint(10) NOT NULL auto_increment COMMENT '主键',
  `CITY_CODE` varchar(10) collate utf8_bin NOT NULL COMMENT '地市(城市)编码',
  `CITY_NAME` varchar(256) collate utf8_bin default NULL COMMENT '地市(城市)名称',
  `CITY_DESC` varchar(256) collate utf8_bin default NULL COMMENT '地市(城市)描述',
  `STATE_CODE` varchar(10) collate utf8_bin NOT NULL COMMENT '归属省分(州)编码',
  `FLAG` varchar(1) collate utf8_bin default NULL COMMENT '0-无效 1-有效',
  PRIMARY KEY  (`CITY_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=101043 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

