/*Table structure for table `hw_goods_info` */

DROP TABLE IF EXISTS `hw_goods_info`;

CREATE TABLE `hw_goods_info` (
  `GOOD_ID` bigint(16) NOT NULL auto_increment COMMENT '主键',
  `GOOD_NAME` varchar(128) default NULL COMMENT '名字',
  `COMMENTS` varchar(255) default NULL COMMENT '备注',
  `LISTPIC` bigint(8) default NULL COMMENT '对应fileRelationId   log图',
  `GOOD_TYPE` varchar(4) default NULL COMMENT '商品类型：\r\n01：16K白卡\r\n02：32K白卡\r\n03：手机',
  `PRICE` bigint(16) default NULL COMMENT '价格  以厘为单位',
  `CREATETIME` datetime default NULL,
  `UPDATETIME` datetime default NULL,
  `CREATOR` varchar(255) default NULL,
  `UPDATOR` varchar(255) default NULL,
  `SALEPRICE` bigint(20) NOT NULL COMMENT '销售价格',
  PRIMARY KEY  (`GOOD_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

