/*Table structure for table `hw_menu` */

DROP TABLE IF EXISTS `hw_menu`;

CREATE TABLE `hw_menu` (
  `MENU_ID` bigint(16) NOT NULL auto_increment,
  `PARENT_ID` bigint(16) default NULL,
  `MENU_NAME` varchar(64) default NULL,
  `MENU_URL` varchar(128) default NULL,
