/*Table structure for table `hw_mobile` */

DROP TABLE IF EXISTS `hw_mobile`;

CREATE TABLE `hw_mobile` (
  `MID` bigint(20) NOT NULL auto_increment COMMENT '主键',
  `MOBILEID` bigint(65) default NULL COMMENT '10010网站上的终端手机Id',
  `BSSMOBILEID` bigint(65) default NULL COMMENT 'bss的id',
  `BRAND` varchar(8) collate utf8_bin default NULL COMMENT '品牌',
  `MOBILEMODEL` varchar(64) collate utf8_bin default NULL COMMENT '型号',
  `PRICE` bigint(65) default NULL COMMENT '价格',
  `COLOR` varchar(128) collate utf8_bin default NULL COMMENT '颜色',
  `EXTERIOR` varchar(256) collate utf8_bin default NULL COMMENT '外观，翻盖和直板',
  `IFINTELLIGENT` varchar(1) collate utf8_bin default NULL COMMENT '是否智能',
  `OS` varchar(256) collate utf8_bin default NULL COMMENT '操作系统',
  `NETWORK` varchar(256) collate utf8_bin default NULL COMMENT '网络频率',
  `TRANSMISSION` varchar(256) collate utf8_bin default NULL COMMENT '数据传输',
  `BROWSER` varchar(256) collate utf8_bin default NULL COMMENT '浏览器',
  `MEMORY` varchar(256) collate utf8_bin default NULL COMMENT '内存',
  `EXTRAMEMORY` varchar(256) collate utf8_bin default NULL COMMENT '扩展内存',
  `SCREEN` varchar(256) collate utf8_bin default NULL COMMENT '屏幕尺寸',
  `VIDEOFORMAT` varchar(600) collate utf8_bin default NULL COMMENT '视频格式',
  `IFRECOMMEND` varchar(8) collate utf8_bin default NULL COMMENT '任意推荐',
  `IFBRANDRECOMMEND` varchar(8) collate utf8_bin default NULL COMMENT '品牌内推荐',
  `VALID` varchar(256) collate utf8_bin default NULL COMMENT '是否有效',
  `FEATURE` varchar(256) collate utf8_bin default NULL COMMENT '特征',
  `LIST_PIC` bigint(65) default NULL COMMENT '列表展示图片',
  `DETAIL_PIC` bigint(65) default NULL COMMENT '信息展示图片',
  `TITLE` varchar(255) collate utf8_bin default NULL COMMENT '标题',
  `DETAILINFOURL` varchar(512) collate utf8_bin default NULL COMMENT '访问的URL',
  `FILEPATH` varchar(512) collate utf8_bin default NULL COMMENT '抓取文件路径',
  `PRESENT` varchar(512) collate utf8_bin default NULL COMMENT '赠送',
  `ISWIDESCREEN` varchar(16) collate utf8_bin default NULL COMMENT '是否宽屏',
  `SCREENTYPE` varchar(256) collate utf8_bin default NULL COMMENT '屏幕类型',
  `RESOLUTION` varchar(256) collate utf8_bin default NULL COMMENT '分辨率',
  `TOUCHSCREEN` varchar(16) collate utf8_bin default NULL COMMENT '触摸屏',
  `MUSICTYPE` varchar(512) collate utf8_bin default NULL COMMENT '音乐类型',
  `JAVA` varchar(256) collate utf8_bin default NULL COMMENT '是否支持JAVA',
  `FM` varchar(256) collate utf8_bin default NULL COMMENT '是否支持收音机',
  `MMS` varchar(256) collate utf8_bin default NULL COMMENT '是否支持彩信',
  `OFFICE` varchar(256) collate utf8_bin default NULL COMMENT '是否支持OFFICE',
  `PIXELS` varchar(256) collate utf8_bin default NULL COMMENT '摄像头像素',
  `GPS` varchar(16) collate utf8_bin default NULL COMMENT 'gps定位',
  `BLUE` varchar(256) collate utf8_bin default NULL COMMENT '蓝牙',
  `BATTERYTYPE` varchar(256) collate utf8_bin default NULL COMMENT '电池类型',
  `BATTERYSPACE` varchar(128) collate utf8_bin default NULL COMMENT '电池容量',
  `PHONESIZE` varchar(256) collate utf8_bin default NULL COMMENT '尺寸',
  `WEIGHT` varchar(256) collate utf8_bin default NULL COMMENT '重量',
