/*Table structure for table `hw_operator` */

DROP TABLE IF EXISTS `hw_operator`;

CREATE TABLE `hw_operator` (
  `OPERATOR_ID` bigint(20) NOT NULL auto_increment COMMENT '主键',
  `OPERATOR_USERCODE` varchar(256) default NULL COMMENT '登陆工号',
  `OPERATOR_NET_ID` bigint(20) default NULL COMMENT '网点',
  `OPERATOR_TITLE` varchar(16) default NULL COMMENT 'MISS.MRS.MR...',
  `FIRST_NAME` varchar(64) default NULL,
  `LAST_NAME` varchar(64) default NULL,
  `GENDER` varchar(8) default NULL COMMENT '性别',
  `OPERATOR_PWD` varchar(255) default NULL COMMENT '登陆密码',
  `DATE_OF_BIRTH` datetime default NULL COMMENT '生日',
  `CONTACT_NUMBER` varchar(64) default NULL COMMENT '联系电话',
  `EMAIL` varchar(256) default NULL COMMENT 'email地址',
  `PHONE_NUMBER` varchar(64) default NULL COMMENT '手机号',
  `HOUSE_NUMBER` varchar(64) default NULL COMMENT '门牌号',
  `POST_CODE` varchar(32) default NULL COMMENT '邮编',
  `HOUSE_BUILDING_NAME` varchar(128) default NULL COMMENT '楼号',
  `STREET` varchar(64) default NULL COMMENT '街道',
  `CITY_TOWN` varchar(128) default NULL COMMENT '城市',
  `OPERATOR_ID_NUMBER` varchar(128) default NULL COMMENT '证件号',
  `SHOW_PIC` bigint(20) default NULL COMMENT '图片相对地址',
  `OPERATOR_ID_TYPE` varchar(16) default NULL,
  `ADDRESS` varchar(512) default NULL,
  `OPERATOR_STATUS` varchar(1) default NULL COMMENT '工号状态',
  `OPERATOR_TYPE` varchar(16) default NULL COMMENT '工号类型',
  `CREATETIME` datetime default NULL COMMENT '创建时间',
  `UPDATETIIME` datetime default NULL COMMENT '修改时间',
  `CREATEOR` bigint(20) default NULL,
  `UPDATEER` bigint(20) default NULL,
  `REASON` varchar(255) default NULL COMMENT '理由',
  `DENY_TIME` datetime default NULL COMMENT '注销时间',
  `APPROVE_TIME` datetime default NULL COMMENT '申请通过时间',
  `PAY_PWD` varchar(255) default NULL COMMENT '支付密码',
  `SLFID` int(20) default NULL,
  `MEMBERS` varchar(1024) default NULL COMMENT '成员的信息()',
  PRIMARY KEY  (`OPERATOR_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2052 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

