/*Table structure for table `hw_order_detail` */

DROP TABLE IF EXISTS `hw_order_detail`;

CREATE TABLE `hw_order_detail` (
  `DETAIL_ID` bigint(16) NOT NULL auto_increment,
  `ORDER_ID` bigint(16) default NULL,
  `GOOD_ID` bigint(16) default NULL COMMENT '商品ID',
  `ORDERTYPE` varchar(4) default NULL COMMENT '订单类型：\r\n01：16K白卡 \r\n02：32K白卡\r\n03：手机',
