/*Table structure for table `hw_product` */

DROP TABLE IF EXISTS `hw_product`;

CREATE TABLE `hw_product` (
  `RANGEID` bigint(65) NOT NULL auto_increment,
  `BSS_ACCEPT_RANGE_ID` bigint(65) default NULL,
  `SVCLEVEL` varchar(16) collate utf8_bin default NULL COMMENT '销售包等级',
  `CONSUMPTION` bigint(65) default NULL COMMENT '保底消费',
  `PRESTORE` bigint(65) default NULL COMMENT '初始预存',
  `PACKEDPHONE` bigint(65) default NULL COMMENT '终端',
  `PREFERENCE` varchar(16) collate utf8_bin default NULL COMMENT '偏好',
  `TERMS` varchar(1) collate utf8_bin default NULL COMMENT '合约期数',
  `SERVICETYPE` varchar(8) collate utf8_bin default NULL COMMENT '业务类型',
  `PACKEDNAME` varchar(256) collate utf8_bin default NULL COMMENT '销售包名称',
  `CONTRACTID` bigint(65) default NULL COMMENT '合约信息id',
  `ACTIVITYID` varchar(255) collate utf8_bin default NULL COMMENT '网站活动ID',
  `ACTTYPE` varchar(64) collate utf8_bin default NULL,
  `ACTTYPEDES` varchar(128) collate utf8_bin default NULL,
  `MOBILEID` bigint(20) default NULL,
  `PERIOD` varchar(16) collate utf8_bin default NULL,
  `MACHINETYPEID` varchar(128) collate utf8_bin default NULL,
  `PRICE` bigint(20) default NULL,
  `THAWMON` bigint(20) default NULL,
  `RESOURCESFEE` bigint(20) default NULL,
  `PRESENETEDFEE` bigint(20) default NULL,
  `ALLFEE` bigint(20) default NULL COMMENT '所有返还的费用',
  `STOREDFEE` bigint(20) default NULL,
  `STOREDDESC` varchar(255) collate utf8_bin default NULL COMMENT '预存描述',
  `RECOMMEND` varchar(1) collate utf8_bin default NULL COMMENT '是否推荐',
  `PRODUCT_DESC` varchar(128) collate utf8_bin default NULL,
  `PAYTYPE` varchar(1) collate utf8_bin default NULL COMMENT '''0 预付费，1,带终端后付费 ，2，后付费 sim，3 data-sim 都是不带终端的 9是bolt-on套餐'',',
  `VALIDTIME` datetime default NULL,
  `INVALIDTIME` datetime default NULL,
  PRIMARY KEY  (`RANGEID`)
) ENGINE=InnoDB AUTO_INCREMENT=1000010 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT;

