/*Table structure for table `hw_small_local_file` */

DROP TABLE IF EXISTS `hw_small_local_file`;

CREATE TABLE `hw_small_local_file` (
  `SLFID` int(11) NOT NULL auto_increment COMMENT '证件ID',
  `CONTENT_BLOB` mediumblob COMMENT '证件二进制对象',
  `FILE_EXT` varchar(8) default NULL COMMENT '后缀名  格式',
  `CREATE_TIME` datetime default NULL COMMENT '创建时间',
  `OPT_ID` int(11) default NULL COMMENT '操作人',
  `ORDER_ID` int(11) default NULL,
  `FILE_NAME` varchar(20) default NULL COMMENT '文件名',
  `FILE_INDEX` int(5) default NULL COMMENT '文件序号',
  `ORDER_DOMAIN` varchar(2) default NULL COMMENT '01:表示 orderid取自order_recode  02：表示orderid取自com_busi_flow',
  PRIMARY KEY  (`SLFID`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

