/*Table structure for table `hw_state` */

DROP TABLE IF EXISTS `hw_state`;

CREATE TABLE `hw_state` (
  `STATE_ID` bigint(10) NOT NULL auto_increment COMMENT '主键',
  `STATE_CODE` varchar(10) collate utf8_bin NOT NULL COMMENT '省分(州)编码',
  `STATE_NAME` varchar(256) collate utf8_bin default NULL COMMENT '省分(州)名称',
  `STATE_DESC` varchar(256) collate utf8_bin default NULL COMMENT '省分(州)描述',
  `FLAG` varchar(1) collate utf8_bin default NULL COMMENT '0-无效 1-有效',
  PRIMARY KEY  (`STATE_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=10028 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

