/*Table structure for table `hw_svn` */

DROP TABLE IF EXISTS `hw_svn`;

CREATE TABLE `hw_svn` (
  `svn` varchar(16) NOT NULL COMMENT '手机号码',
  `status` varchar(1) default NULL COMMENT '号码状态',
  `amount` decimal(20,0) default NULL COMMENT '账户余额（里）',
  `startTime` datetime default NULL COMMENT '创建时间',
  `startUser` varchar(255) default NULL COMMENT '创建人',
  `customer` bigint(255) default NULL COMMENT '用户资料',
  `svnId` bigint(20) NOT NULL auto_increment,
  `svcLevel` bigint(20) default NULL COMMENT '号码等级',
  PRIMARY KEY  (`svnId`)
) ENGINE=InnoDB AUTO_INCREMENT=514 DEFAULT CHARSET=utf8;

